INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (14112, 0, 1, 10, 1, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。", 0, 0.5, 105611, 14112030, 11);
