INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (16612, 0, 1, 10, 1, "まったくもう……\nみんなして絵の具まみれじゃない。\nって、あら？　この赤いのは……", 0, 0.5, 105111, 16612041, 11);
