INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (18812, 0, 1, 10, 1, "完☆成！\nぐうかわ魔法少女が描く、\nこれまたぐうかわな壁画をご覧あれ～！\nテーマは……努力！　友情！　勝利！", 0, 0.5, 101311, 18812026, 11);
