INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (18812, 0, 1, 10, 1, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 0, 0.5, 100911, 18812031, 11);
