INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812, 0, 1, 10, 1, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 0, 0.5, 100811, 23812026, 11);
