INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812, 0, 1, 10, 1, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 0, 0.5, 104511, 23812031, 11);
