INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812, 0, 1, 10, 1, "オー、まさに陰と陽！\nこれがゲージュツの分野で\nいうところの、コントラストと\nいうヤツなのでショウか？", 0, 0.5, 103011, 23812036, 11);
