INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (28412, 0, 1, 10, 1, "このクリスティーナが手伝う以上、\n粗い仕事など許さん！\nまったく、オマエたちはもう少し、\n芸術を嗜むべきだぞ♪", 0, 0.5, 107111, 28412032, 11);
