INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (28412, 0, 1, 10, 1, "クリスちゃんは相変わらずだね。\nでも、描き直したおかげで\nさらに良い絵になったと思うよ。\n私も鎧に絵の具がはねなくて一安心だ。", 0, 0.5, 104711, 28412037, 11);
