INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (39512, 0, 1, 10, 1, "どれどれ……問題ありませんわ。\nただ、麦しゅわはちゃんと量を\n考えてたしなむべきです。\nそのうち体を壊しますわよ？", 0, 0.5, 103211, 39512027, 11);
