INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (39512, 0, 1, 10, 1, "もう既に二日酔いになってるにゃ。\n麦しゅわを飲んだことがないから、\nユカリがひたすら麦しゅわを\n求める気持ちが分かんないにゃ。", 0, 0.5, 104611, 39512032, 11);
